import { TestBed } from '@angular/core/testing';
import { ChatEventService } from 'src/app/services/chat-event.service';
import { DetailedChatHistoryComponent } from './detailed-chat-history.component';
describe('DetailedChatHistoryComponent', () => {
    let component;
    let fixture;
    let chatServiceStub;
    beforeEach(async () => {
        // chatServiceStub = {getAll: (): Observable<ChatEvent[]> => {}};
        chatServiceStub = jasmine.createSpyObj('ChatEventService', ['getAll']);
        await TestBed.configureTestingModule({
            declarations: [DetailedChatHistoryComponent],
            providers: [{ provide: ChatEventService, useValue: jasmine.createSpyObj('ChatEventService', ['getAll']) }]
        })
            .compileComponents();
    });
    beforeEach(() => {
        fixture = TestBed.createComponent(DetailedChatHistoryComponent);
        component = fixture.componentInstance;
        fixture.detectChanges();
    });
    it('should create', () => {
        expect(component).toBeTruthy();
    });
});
